import './App.css';
import './Button'
const Header=()=>{
  const sayHello =(uname)=>{
    return(
      <div>
        <h1>Welcome to {uname}</h1>
        </div>
    )
  }
  return (
      <div>
        {sayHello('Abdulbosit')}
      </div>
  )
}

const Field=()=>{
  return(
    <input type='text' placeholder='new componenet'/>
  )
}

function App() {
  return (
    <div className="App">
      <Header/>
      <Field/> <Button/>
    </div>
    
  );
}

export default App;
